import React from "react";
import { Page, Title, FieldInput } from "./styles";

function InputTask(){
    return (
        <FieldInput>
            <input type= "text" placeholder="Add new task" />    
        </FieldInput>
    )
}



function Tasks() {
    return (
        <Page>
            <Title>TaskDo</Title>
            <InputTask />
        </Page>
    )

}

export default Tasks
